function GetCookie(e){try{var o=document.cookie,t=o.indexOf(e+"=")+1;if(0===t)return null;t+=e.length;var n=o.indexOf(";",t);return n==-1&&(n=o.length),decodeURIComponent(o.substring(t,n))}catch(e){}return null}function SetCookie(e,o,t){var n=e+"="+escape(o)+(0!==t?"; path=/; expires="+new Date((new Date).getTime()+t).toUTCString()+";":"; path=/;");document.cookie=n}function CanSetCookies(){SetCookie("CookieTest","true",0);var e=null!==GetCookie("CookieTest");return DelCookie("CookieTest"),e}function DelCookie(e){document.cookie=e+"=0; path=/; expires=Thu, 01 Jan 1970 00:00:01 GMT;"}